/**
 * Animate in a thought bubble above a character.
 */
function thinks(element) {
  alignThoughtBubbleWithCharacter(element);

  var element = $(element);

  element.children().hide();
  element.show();

  element.find(".first")  .delay(250)  .fadeIn();
  element.find(".second") .delay(500)  .fadeIn();
  element.find(".third")  .delay(750)  .fadeIn();
  element.find(".thinks") .delay(1000) .fadeIn();
}

/**
 * Ensure the thought bubble appears (approximately) aligned with the characters' head.\
 */
function alignThoughtBubbleWithCharacter(bubble, potentialCharacters) {
  bubble = $(bubble);

  if (potentialCharacters === undefined) {
    potentialCharacters = bubble.siblings()
  }

  const characterId = $(bubble).attr("character");

  let character = null;

  if (characterId) {
    character = potentialCharacters.find("#" + characterId);
  }

  if (!character) {
    // Find the nearest image tag with the .character class that is visible.
    character = potentialCharacters.filter(".character")

    if (character.length > 1) {
      character = potentialCharacters.filter(".character:visible")
    }
  }

  // If there are multiple characters showing, choose the nearest on the x-axis.
  if (character.length > 1) {
    const xOffsets = character.map(function(i, match) {
      let offset = bubble.offset().left;

      // *Sigh* - since the speech bubble isn't visible, we will probably have
      // get the position from the parent, which is hopefully a good guess.
      if (offset === 0) {
        offset = bubble.parent().offset().left;
      }

      return Math.abs($(match).offset().left - offset);
    })

    let closest  = 0;
    let minSoFar = xOffsets[0];

    for (let i = 1; i < xOffsets.length; i++) {
      if (xOffsets[i] < minSoFar) {
        minSoFar = xOffsets[i];
        closest = i;
      }
    }

    character = $(character[closest]);
  }

  // Give up.
  if (character.length !== 1) {
    return
  }

  const width = character.width() || 200;

  // If we can identify the character, add a custom offset.
  const src = character.attr('src');
  let offset = 0;

  if (src) {
    if (src.indexOf("slim-concentrating") > 0) {
      offset = 50;
    }
    else if (src.indexOf("slim-neutral") > 0) {
      offset = 65;
    }
    else if (src.indexOf("slim-malevolent") > 0) {
      offset = 30;
    }
    else if (src.indexOf("mal-hacking-flipped") > 0) {
      offset = 30;
    }
    else if (src.indexOf("mal-hacking") > 0) {
      offset = 30;
    }
    else if (src.indexOf("mal-pensive") > 0) {
      offset = 30;
    }
    else if (src.indexOf("mal-succeed") > 0) {
      offset = 0;
    }
    else if (src.indexOf("vic-neutral-flipped") > 0) {
      offset = 90;
    }
    else if (src.indexOf("vic-excited-flipped") > 0) {
      offset = 70;
    }
    else if (src.indexOf("vic-confused-flipped") > 0) {
      offset = 90;
    }
    else if (src.indexOf("vic-hamster") > 0) {
      offset = 100;
    }
    else if (src.indexOf("vic-dismayed-hamster") > 0) {
      offset = 100;
    }
    else if (src.indexOf("trix-malicious") > 0) {
      offset = 20;
    }
    else if (src.indexOf("trix-concentrating") > 0) {
      offset = 20;
    }
    else if (src.indexOf("trix-frustrated") > 0) {
      offset = 40;
    }
    else if (src.indexOf("trix-neutral") > 0) {
      offset = 20;
    }
  }


  // Adjust the position of the speech bubble to the character.
  bubble.find(".bubble.thinks")  .css({ left: offset })
  bubble.find(".bubble.first")   .css({ left: offset + width / 2 })
  bubble.find(".bubble.second")  .css({ left: offset + width / 2 })
  bubble.find(".bubble.third")   .css({ left: offset + width / 2 })
};
